import React from "react";
import Navbar from "./components/Navbar/Navbar";
import {BrowserRouter,Route,Routes} from 'react-router-dom';
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route exact path="/login"/>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
